import "./Unit.css";
import { useDispatch } from "react-redux";


export default function Unit(props) {
    const status = props.board;
    let symbol = "";
    const dispatch = useDispatch();
    function help(){
        dispatch(
            {
                type:"boardClick",
                need:props.index,
            })
    }
    function check() {
        if(status === "yes") {
            console.log("hiiiiiiiiiiii")
            symbol = "X"
        }else if(status === "no"){
            symbol = "Y"
        }
    }
    return (<div className = "white" onClick = {function(event){ help(); check()}}>{symbol}</div>);
}
